import { useEffect, useState } from "react";
import axios from "axios";

function TicketsManagement() {
  const [tickets, setTickets] = useState([]);
  const [formData, setFormData] = useState({
    code: "",
    flight: "",
    price: "",
    status: "",
  });
  const [editingId, setEditingId] = useState(null);

  useEffect(() => {
    fetchTickets();
  }, []);

  const fetchTickets = () => {
    axios
      .get("http://localhost:5000/api/tickets")
      .then((res) => setTickets(res.data))
      .catch((err) => console.error(err));
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (editingId) {
      axios
        .put(`http://localhost:5000/api/tickets/${editingId}`, formData)
        .then(fetchTickets);
    } else {
      axios
        .post("http://localhost:5000/api/tickets", formData)
        .then(fetchTickets);
    }
    setFormData({ code: "", flight: "", price: "", status: "" });
    setEditingId(null);
  };

  const handleEdit = (ticket) => {
    setFormData({
      code: ticket.code,
      flight: ticket.flight,
      price: ticket.price,
      status: ticket.status,
    });
    setEditingId(ticket.id);
  };

  const handleDelete = (id) => {
    axios.delete(`http://localhost:5000/api/tickets/${id}`).then(fetchTickets);
  };

  return (
    <div>
      <h2>Quản lý Vé máy bay</h2>

      <form onSubmit={handleSubmit}>
        <input
          placeholder="Mã vé"
          value={formData.code}
          onChange={(e) => setFormData({ ...formData, code: e.target.value })}
          required
        />
        <input
          placeholder="Chuyến bay"
          value={formData.flight}
          onChange={(e) => setFormData({ ...formData, flight: e.target.value })}
          required
        />
        <input
          placeholder="Giá vé"
          value={formData.price}
          onChange={(e) => setFormData({ ...formData, price: e.target.value })}
          required
        />
        <input
          placeholder="Trạng thái"
          value={formData.status}
          onChange={(e) => setFormData({ ...formData, status: e.target.value })}
          required
        />
        <button type="submit">{editingId ? "Cập nhật" : "Thêm"}</button>
      </form>

      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Mã vé</th>
            <th>Chuyến bay</th>
            <th>Giá</th>
            <th>Trạng thái</th>
            <th>Hành động</th>
          </tr>
        </thead>
        <tbody>
          {tickets.map((ticket) => (
            <tr key={ticket.id}>
              <td>{ticket.id}</td>
              <td>{ticket.code}</td>
              <td>{ticket.flight}</td>
              <td>{ticket.price}</td>
              <td>{ticket.status}</td>
              <td>
                <button onClick={() => handleEdit(ticket)}>Chỉnh sửa</button>
                <button onClick={() => handleDelete(ticket.id)}>Xóa</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default TicketsManagement;
